import React from 'react'

export default function Services() {
  const services = [
    {
      title: 'IT Services',
      description: 'Reliable IT support and consulting for your business.',
    },
    {
      title: 'Software Development',
      description: 'Custom software solutions tailored to your needs.',
    },
    {
      title: 'Website Development',
      description: 'Modern, responsive websites that grow your brand.',
    },
    {
      title: 'Landing Pages',
      description: 'High-converting landing pages to boost your marketing.',
    },
  ]

  return (
    <section id="services" className="p-12 bg-gray-100 text-gray-900">
      <h2 className="text-4xl font-bold mb-10 text-center">Our Services</h2>
      <div className="max-w-5xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-8">
        {services.map(({ title, description }) => (
          <div key={title} className="bg-white p-6 rounded shadow">
            <h3 className="text-2xl font-semibold mb-3">{title}</h3>
            <p>{description}</p>
          </div>
        ))}
      </div>
    </section>
  )
}
